import React from 'react'
import "./App.css"
import dbzvs from './images/dbzvs.png'

const Layout = () => {
    return (
        <div className="jumbotron">
            <img style={{transform: "translate(0%, -50%)"}} className="dbzvs" src={dbzvs} alt="dbzvs" />
            <p>Hello</p>
        </div>
    )
}
export default Layout;
